from drb.spawn import SpawnedProcessError, sp
from unittest2 import TestCase, skipIf
from click.testing import CliRunner
import os
import sys
import base64

from drb.tempdir import TempDir
from drb.commands.srcrpm import srcrpm
from drb.docker import Docker

REFERENCE_IMAGE = "alanfranz/drb-epel-7-x86-64:latest"

class TestSrcRpmCommand(TestCase):
    def setUp(self):
        self.runner = CliRunner()
        self.src = TempDir.platformwise()
        self.rpm = TempDir.platformwise()


    def tearDown(self):
        self.src.delete()
        self.rpm.delete()

    def test_srcrpm_building(self):
        with open(os.path.join(self.src.path, "tmux.src.rpm"), "wb") as f:
            f.write(base64.decodestring(TMUX_143_SRC_RPM_B64))

        self.runner.invoke(srcrpm, [REFERENCE_IMAGE, os.path.join(self.src.path, "tmux.src.rpm"), self.rpm.path],  catch_exceptions=False)
        self.assertEquals(2, len(os.listdir(os.path.join(self.rpm.path, "x86_64"))))








